class Node
  attr_reader :val
  attr_accessor :left, :right
  def initialize(val)
    @val = val
    @left = nil
    @right = nil
  end
  def to_s()
    if @left == nil
      left = "nil"
    else
      left = @left.to_s
    end

    if @right == nil
      right = "nil"
    else
      right = @right.to_s
    end

    "(" + @val.to_s + ", " + left + ", " + right + ")"
  end
end

class BinaryTree
  def initialize()
    @root = nil
  end
  def insertNode(val)
    if @root == nil
      @root = Node.new(val)
      return
    end

    parent = nil
    child = @root
    while child != nil
      parent = child
      if val < parent.val
        child = child.left
      else
        child = child.right
      end
    end

    if val < parent.val
      parent.left = Node.new(val)
    else
      parent.right = Node.new(val)
    end
  end
  def to_s()
    @root.to_s
  end
end

